Home.propTypes = {
  selectedCategories: PropTypes.arrayOf(PropTypes.string),
  selectedYear: PropTypes.oneOfType([
    PropTypes.string,
    PropTypes.shape({
      start: PropTypes.string,
      end: PropTypes.string,
    }),
  ]),
};

// ✅ Ajout de valeurs par défaut pour éviter l'erreur `null`
Home.defaultProps = {
  selectedCategories: [],
  selectedYear: '',
};
